import React from 'react'
import { UseUserContext } from './hooks/useUserContext';
import './App.css'
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import Login from './Pages/Login.js'
import Choice from './Pages/choice.js';
import SignupPage from './Pages/SignUp.js';
import HireForm from './Pages/HireForm.js';
import HomeHire from './Pages/homeVol.js'


function App() {
  const {user} = UseUserContext()
  return (
  <div className='app-div'>
  <Router>
    <Routes>
      <Route exact path='/login' element={!user ? <Login /> : <Choice />} />
      <Route exact path='/choice' element={<Choice />} />
      <Route exact path='/signup' element={<SignupPage />} />
      <Route exact path='/hireform' element={<HireForm />} />
      <Route exact path='/volunteer' element={<HomeHire/>} />
      <Route exact path='/choice' element={<Choice/>} />
    </Routes>
  </Router>
  </div>);
}

export default App;
